import {useEffect, useState} from 'react';

function ListStaff() {
    const [staffs, setStaffs] = useState([]);
    var staffsAPI = 'http://localhost:5000/staff/get_all'
    useEffect(() => {
        const getStaffs = async () => {
            const res = await (await fetch(staffsAPI)).json();
            setStaffs(res);
        };
        getStaffs();
    }, []);
    console.log(staffs);
    return (
        <div className='staffs_table'>
            Danh sách nhân viên
            <table id="customers">
                <tr>
                    <th>ID</th>
                    <th>Tên</th>
                    <th>SĐT</th>
                    <th>Email</th>
                </tr>
                {staffs.map(staff => (
                    <tr>
                        <th>{staff.id}</th>
                        <th>{staff.name}</th>
                        <th>{staff.phone}</th>
                        <th>{staff.email}</th>
                        <th>{staff.address}</th>
                    </tr>
                ))}
                {/* <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Germany</td>
                </tr> */}
            </table>
        </div>
    )
}
export default ListStaff;
